import classes from "./delivery.module.css";
const Delivery = () => {
  return (
    <div className={classes.deliverySection}>
      <div>
        <h1>
          Get 15% cashback + <span>FREE DELIVERY</span>
        </h1>
        <p>
          on <span>express</span> items on your first order
        </p>
      </div>
      <div>
        <span>Use code :</span>
        <p>FIRST15</p>
      </div>
    </div>
  );
};

export default Delivery;
